import React from 'react'
import styled from 'styled-components'
import PostItem from './PostItem'

const List = styled.div`
  max-width: 400px;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
`

function PostsList() {
  return (
    <List>
      <PostItem />
    </List>
  )
}

export default PostsList
